async function loadWallet(runtime, requirePrivateKey = true) {
  const teeMode = runtime.getSetting("TEE_MODE") || "OFF" /* OFF */;
  if (teeMode !== "OFF" /* OFF */) {
    const walletSecretSalt = runtime.getSetting("WALLET_SECRET_SALT");
    if (!walletSecretSalt) {
      throw new Error(
        "WALLET_SECRET_SALT required when TEE_MODE is enabled"
      );
    }
    const deriveKeyProvider = new DeriveKeyProvider(teeMode);
    const deriveKeyResult = await deriveKeyProvider.deriveEd25519Keypair(
      "/",
      walletSecretSalt,
      runtime.agentId
    );
    return requirePrivateKey ? { signer: deriveKeyResult.keypair } : { address: deriveKeyResult.keypair.address };
  }
  if (requirePrivateKey) {
    const privateKeyString = runtime.getSetting("SOLANA_PRIVATE_KEY") ?? runtime.getSetting("WALLET_PRIVATE_KEY");
    if (!privateKeyString) {
      throw new Error("Private key not found in settings");
    }
    try {
      const secretKey = bs58.decode(privateKeyString);
      return { signer: await createKeyPairSignerFromBytes(secretKey) };
    } catch (e3) {
      console.log("Error decoding base58 private key:", e3);
      try {
        console.log("Try decoding base64 instead");
        const secretKey = Uint8Array.from(
          Buffer.from(privateKeyString, "base64")
        );
        return { signer: await createKeyPairSignerFromBytes(secretKey) };
      } catch (e22) {
        console.error("Error decoding private key: ", e22);
        throw new Error("Invalid private key format");
      }
    }
  } else {
    const publicKeyString = runtime.getSetting("SOLANA_PUBLIC_KEY") ?? runtime.getSetting("WALLET_PUBLIC_KEY");
    if (!publicKeyString) {
      throw new Error("Public key not found in settings");
    }
    return { address: address(publicKeyString) };
  }
}

